import React from "react";
import Card from "@mui/material/Card";

function Content() {
  return (
    <div>
      <div style={{ display: "flex", flexDirection: "row" }}>
        <div
          style={{
            borderBottom: 2,
            borderColor: "#3772FF",
            borderStyle: "",
            color: "#fff",
            fontSize: 22,
            fontWeight: "bold",

            fontFamily: "Poppins",
          }}
        >
          Section
        </div>
        <div>
          <Card variant="outlined" style={{backgroundColor:"#3772FF"}}>
            <Card  style={{backgroundColor:"#3772FF"}}>Tier 1</Card>
          </Card>
        </div>
      </div>
    </div>
  );
}

export default Content;
